import React from "react";
import products from "../../data/products";

export default (props) => {

  const productsList = products.map((product) => {
    return (
      <li key={product.id}>
        {product.id} : {product.name} - {product.price}
      </li>
    );
  });
  return (
    <div>
      <ul style={{ listStyle: "none" }}>{productsList}</ul>
    </div>
  );
};
